INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (9444, 180, 'Moxifloxacin', 'Myasthenia Gravis', 'Fluoroquinolones have neuromuscular blocking activity and may exacerbate muscle weakness in persons with myasthenia gravis.  Postmarketing serious adverse events, including deaths and requirement for ventilatory support, have been associated with fluoroquinolones use in persons with myasthenia gravis.  Fluoroquinolones should be avoided in patients with history of myasthenia gravis.', '3', '', 'DDInter', 0);
