INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (9497, 180, 'Moxifloxacin', 'Peripheral Nervous System Diseases', 'The use of quinolones has been associated with an increased risk of peripheral neuropathy.  Monitor closely and discontinue their use in patients experiencing symptoms of peripheral neuropathy.  It is recommended to avoid these agents in patients who have previously experienced peripheral neuropathy.', '3', '', 'DDInter', 0);
